import express from 'express';
import OpenAI from 'openai';
import config from '../config.js';
import { md2docx } from '@adobe/helix-md2docx';
import { marked } from 'marked';
import puppeteer from 'puppeteer';
import { addWatermarkToPDFBuffer } from './pdfDamageRoutes.js';

const router = express.Router();

// Statik filigran ayarlarÄ±
const DEFAULT_WATERMARK = {
    url: 'data:image/png;base64,', // kendi istediÄin gÃ¶rsel
    options: {
        opacity: 0.15,
        scale: 0.6,
        rotation: 0,
        position: 'center'
    }
};

const openai = new OpenAI({
    apiKey: config.openai.apiKey
});

// JSON'Ä± Markdown'a Ã§eviren fonksiyon
async function convertJsonToMarkdown(jsonData) {
    try {
        const prompt = `Convert the following JSON data into a well-formatted markdown document. 
        Include proper headings, bold text, and maintain the structure. 
        The output should be clean and professional looking markdown:
        
        ${JSON.stringify(jsonData, null, 2)}`;

        const completion = await openai.chat.completions.create({
            model: config.openai.defaultModel,
            messages: [
                {
                    role: "system",
                    content: "You are a professional document formatter. Convert the given JSON into well-formatted markdown."
                },
                {
                    role: "user",
                    content: prompt
                }
            ],
            temperature: 0.3
        });

        let markdownContent = completion.choices[0].message.content;
        if (markdownContent.startsWith('```\n')) {
            markdownContent = markdownContent.substring(4);
        }
        if (markdownContent.endsWith('\n```')) {
            markdownContent = markdownContent.substring(0, markdownContent.length - 4);
        }
        if (markdownContent.startsWith('"') && markdownContent.endsWith('"')) {
            markdownContent = markdownContent.substring(1, markdownContent.length - 1);
        }
        return markdownContent.trim();
    } catch (error) {
        console.error('JSON to Markdown conversion error:', error);
        throw new Error('Failed to convert JSON to Markdown');
    }
}

router.post('/generate-report', async (req, res) => {
    try {
        const jsonData = req.body;
        const format = req.query.format || 'docx';
        
        // Filigran ayarlarÄ±nÄ± al veya varsayÄ±lanÄ± kullan
        const watermarkData = req.query.watermark || DEFAULT_WATERMARK.url;
        const watermarkOptions = req.query.watermarkOptions 
            ? JSON.parse(req.query.watermarkOptions) 
            : DEFAULT_WATERMARK.options;

        // JSON'Ä± Markdown'a Ã§evir
        const markdownContent = await convertJsonToMarkdown(jsonData);
        console.log('Generated Markdown:\n', markdownContent);

        // Markdown'Ä± DOCX'e Ã§evir
        const docxBuffer = await md2docx(markdownContent);

        if (format === 'pdf') {
            // Markdown'Ä± HTML'e Ã§evir
            const htmlContent = marked.parse(markdownContent);
            
            // PDF iÃ§in Ã¶zel CSS ekle
            const customStyles = `
                <style>
                    body {
                        font-family: 'Arial', sans-serif;
                        line-height: 1.6;
                        color: #333333;
                        max-width: 800px;
                        margin: 40px auto;
                        padding: 20px;
                    }
                    h1, h2, h3 {
                        color: #113a5c;
                    }
                    h1 {
                        border-bottom: 2px solid #3498db;
                        padding-bottom: 10px;
                        margin-bottom: 20px;
                    }
                    h2 {
                        margin-top: 30px;
                    }
                    h3 {
                        /* margin-top: 20px; */
                    }
                    p {
                        margin-bottom: 15px;
                    }
                    ul, ol {
                        margin-left: 20px;
                        margin-bottom: 15px;
                    }
                    li {
                        margin-bottom: 8px;
                    }
                    table {
                        width: 100%;
                        border-collapse: collapse;
                        margin: 20px 0;
                    }
                    th, td {
                        border: 1px solid #ddd;
                        padding: 12px;
                        text-align: left;
                    }
                    th {
                        background-color: #f5f6fa;
                        color: #2c3e50;
                    }
                    tr:nth-child(even) {
                        background-color: #f9f9f9;
                    }
                    code {
                        background-color: #f8f9fa;
                        padding: 2px 4px;
                        border-radius: 4px;
                        font-family: 'Courier New', monospace;
                    }
                    blockquote {
                        border-left: 4px solid #3498db;
                        margin: 20px 0;
                        padding: 10px 20px;
                        background-color: #f8f9fa;
                        color: #555;
                    }
                </style>
            `;

            // HTML iÃ§eriÄini Ã¶zel CSS ile birleÅtir
            const styledHtmlContent = `
                <!DOCTYPE html>
                <html>
                <head>
                    <meta charset="UTF-8">
                    ${customStyles}
                </head>
                <body>
                    ${htmlContent}
                </body>
                </html>
            `;

            // Puppeteer ile HTML'den PDF oluÅtur
            const browser = await puppeteer.launch({ 
                headless: 'new',
                args: ['--no-sandbox', '--disable-setuid-sandbox']
            });
            const page = await browser.newPage();
            await page.setContent(styledHtmlContent, { waitUntil: 'networkidle0' });
            
            // PDF ayarlarÄ±nÄ± Ã¶zelleÅtir
            const pdfBuffer = await page.pdf({ 
                format: 'A4',
                margin: {
                    top: '20mm',
                    right: '20mm',
                    bottom: '20mm',
                    left: '20mm'
                },
                printBackground: true,
                displayHeaderFooter: true,
                headerTemplate: '<div></div>',
                footerTemplate: '<div style="font-size: 10px; margin-left: 20px; color: #666; width: 100%; text-align: center;">Sayfa <span class="pageNumber"></span> / <span class="totalPages"></span></div>'
            });
            
            await browser.close();

            // FiligranÄ± ekle
            let finalPdfBuffer;
            try {
                finalPdfBuffer = await addWatermarkToPDFBuffer(pdfBuffer, watermarkData, watermarkOptions);
                console.log('Filigran baÅarÄ±yla eklendi');
            } catch (watermarkError) {
                console.error('Filigran eklenirken hata oluÅtu:', watermarkError);
                finalPdfBuffer = pdfBuffer; // Hata durumunda filigransÄ±z PDF'i kullan
            }

            // PDF'i base64 string olarak dÃ¶ndÃ¼r
            const base64Content = Buffer.from(finalPdfBuffer).toString('base64');
            res.json({
                success: true,
                format: 'pdf',
                data: base64Content,
                watermark: {
                    applied: true,
                    url: watermarkData,
                    options: watermarkOptions
                }
            });
            return;
        }

        // DOCX formatÄ± iÃ§in mevcut davranÄ±Å
        const base64Content = Buffer.from(docxBuffer).toString('base64');
        res.json({
            success: true,
            format: 'docx',
            data: base64Content
        });
    } catch (error) {
        console.error('Report generation error:\n', error);
        res.status(500).json({
            success: false,
            error: error.message || 'Failed to generate report'
        });
    }
});

export default router; 